import React from 'react';
import './CaseStudyProjects.css';

// Make sure you're exporting the component
export function CaseStudyProjects({ projects }) {
  return (
    <div>
      {projects.map((project) => (
        <div key={project.id}>
          <h2>{project.title}</h2>
          {/* Other project details */}
        </div>
      ))}
    </div>
  );
}

// Alternatively, if you prefer default export:
// export default function CaseStudyProjects({ projects }) { ... }
